import React from 'react';
import  { Link } from "react-router-dom"

function Nav() {
  return (
    <nav>
        <ul>
            <Link to='/'><li>Home</li></Link> 
            <Link to='/about'><li>Impressum</li></Link>
            <Link to='/shop'><li>Help</li></Link>
        </ul>
    </nav>
  );
}

export default Nav;
